function Certifications() {
  return (
    <section className="md:px-8 lg:px-12 relative flex flex-col">
      <div className="flex flex-col items-center justify-center gap-12">
        <div className="relative overflow-hidden">
          <div className="relative flex flex-col gap-8 px-4 sm:px-6 lg:px-8">
            <h3 className="mx-auto max-w-prose">
              <span className="block text-center text-base font-semibold uppercase tracking-wide text-blue-600 dark:text-blue-400">Certification</span>
            </h3>
          </div>
        </div>
      </div>
    </section>
  )
}
export default Certifications;
